var im1=document.querySelector("#p1 img");
var im2=document.querySelector("#p2 img");
var h=document.querySelector("h1");
function calc() {
    var p1=Math.ceil(Math.random()*6);
    var p2=Math.ceil(Math.random()*6);
    if(p1==1)
    im1.setAttribute("src", "data:image/png;base64,");
    if(p1==2)
    im1.setAttribute("src", "data:image/png;base64,");
    if(p1==3)
    im1.setAttribute("src", "data:image/png;base64,");
    if(p1==4)
    im1.setAttribute("src", "data:image/png;base64,");
    if(p1==5)
    im1.setAttribute("src", "data:image/png;base64,");
    if(p1==6)
    im1.setAttribute("src", "data:image/png;base64,");
    if(p2===1)
    im2.setAttribute("src", "data:image/png;base64,");
    if(p2===2)
    im2.setAttribute("src", "data:image/png;base64,");
    if(p2===3)
    im2.setAttribute("src", "data:image/png;base64,");
    if(p2===4)
    im2.setAttribute("src", "data:image/png;base64,");
    if(p2===5)
    im2.setAttribute("src", "data:image/png;base64,");
    if(p2===6)
    im2.setAttribute("src", "data:image/png;base64,");
    if(p1>p2)
    h.textContent="Player 1 wins";
    else if(p1<p2)
    h.textContent="Player 2 wins";
    else
    h.textContent="Draw";
}